import React from 'react'
import Display from './DisplayCatrgory';
import '../CSS/Cuisine.css'
import pictures from '../../Assets/cuisine.js'
const Cuisine = () => {
  return (
    <div className='Cuisine'>
        <h1>Cuisine</h1>
        <div className='cc'>
        {

          pictures.map((item, index) => (
            <Item key={index} image={item.image} text={item.text} />
          ))
        }
      </div>
      
    </div>
  )
}

export default Cuisine
